pragma solidity >=0.4.0 <0.7.0;

library Utils {event __CoverageUtils(string fileName, uint256 lineNumber);
event __FunctionCoverageUtils(string fileName, uint256 fnId);
event __StatementCoverageUtils(string fileName, uint256 statementId);
event __BranchCoverageUtils(string fileName, uint256 branchId, uint256 locationIdx);
event __AssertPreCoverageUtils(string fileName, uint256 branchId);
event __AssertPostCoverageUtils(string fileName, uint256 branchId);


    function getFileObject(
        string memory _fileLink,
        uint _goal,
        string memory _title,
        string memory _description,
        uint _donated,
        uint _dateCreated,
        uint _index
    ) internal      returns(string memory content) {emit __FunctionCoverageUtils('/Volumes/Data/Projects/Unlock-dApp/contracts/Utils.sol',1);

emit __CoverageUtils('/Volumes/Data/Projects/Unlock-dApp/contracts/Utils.sol',14);
        emit __StatementCoverageUtils('/Volumes/Data/Projects/Unlock-dApp/contracts/Utils.sol',1);
content = string(abi.encodePacked(
            '{\"fileLink\": ', '\"', _fileLink, '\"',
            ', \"goal\": ', '\"', toString(_goal), '\"',
            ', \"title\": ', '\"', _title, '\"',
            ', \"description\": ', '\"', _description, '\"',
            ', \"donated\": ', '\"', toString(_donated), '\"',
            ', \"dateCreated\": ', '\"', toString(_dateCreated), '\"',
            ', \"id\": ', '\"', toString(_index), '\"',
            '}')
        );
    }
    function toString(uint _i) internal      returns (string memory _uintAsString) {emit __FunctionCoverageUtils('/Volumes/Data/Projects/Unlock-dApp/contracts/Utils.sol',2);

emit __CoverageUtils('/Volumes/Data/Projects/Unlock-dApp/contracts/Utils.sol',26);
        emit __StatementCoverageUtils('/Volumes/Data/Projects/Unlock-dApp/contracts/Utils.sol',2);
if (_i == 0) {emit __BranchCoverageUtils('/Volumes/Data/Projects/Unlock-dApp/contracts/Utils.sol',1,0);
emit __CoverageUtils('/Volumes/Data/Projects/Unlock-dApp/contracts/Utils.sol',27);
            emit __StatementCoverageUtils('/Volumes/Data/Projects/Unlock-dApp/contracts/Utils.sol',3);
return "0";
        }else { emit __BranchCoverageUtils('/Volumes/Data/Projects/Unlock-dApp/contracts/Utils.sol',1,1);}

emit __CoverageUtils('/Volumes/Data/Projects/Unlock-dApp/contracts/Utils.sol',29);
        emit __StatementCoverageUtils('/Volumes/Data/Projects/Unlock-dApp/contracts/Utils.sol',4);
uint j = _i;
emit __CoverageUtils('/Volumes/Data/Projects/Unlock-dApp/contracts/Utils.sol',30);
        emit __StatementCoverageUtils('/Volumes/Data/Projects/Unlock-dApp/contracts/Utils.sol',5);
uint len;
emit __CoverageUtils('/Volumes/Data/Projects/Unlock-dApp/contracts/Utils.sol',31);
        emit __StatementCoverageUtils('/Volumes/Data/Projects/Unlock-dApp/contracts/Utils.sol',6);
while (j != 0) {
emit __CoverageUtils('/Volumes/Data/Projects/Unlock-dApp/contracts/Utils.sol',32);
            len++;
emit __CoverageUtils('/Volumes/Data/Projects/Unlock-dApp/contracts/Utils.sol',33);
            emit __StatementCoverageUtils('/Volumes/Data/Projects/Unlock-dApp/contracts/Utils.sol',7);
j /= 10;
        }
emit __CoverageUtils('/Volumes/Data/Projects/Unlock-dApp/contracts/Utils.sol',35);
        emit __StatementCoverageUtils('/Volumes/Data/Projects/Unlock-dApp/contracts/Utils.sol',8);
bytes memory bstr = new bytes(len);
emit __CoverageUtils('/Volumes/Data/Projects/Unlock-dApp/contracts/Utils.sol',36);
        emit __StatementCoverageUtils('/Volumes/Data/Projects/Unlock-dApp/contracts/Utils.sol',9);
uint k = len - 1;
emit __CoverageUtils('/Volumes/Data/Projects/Unlock-dApp/contracts/Utils.sol',37);
        emit __StatementCoverageUtils('/Volumes/Data/Projects/Unlock-dApp/contracts/Utils.sol',10);
j = _i;

emit __CoverageUtils('/Volumes/Data/Projects/Unlock-dApp/contracts/Utils.sol',39);
        emit __StatementCoverageUtils('/Volumes/Data/Projects/Unlock-dApp/contracts/Utils.sol',11);
while (j != 0) {
emit __CoverageUtils('/Volumes/Data/Projects/Unlock-dApp/contracts/Utils.sol',40);
            emit __StatementCoverageUtils('/Volumes/Data/Projects/Unlock-dApp/contracts/Utils.sol',12);
bstr[k--] = byte(uint8(48 + j % 10));
emit __CoverageUtils('/Volumes/Data/Projects/Unlock-dApp/contracts/Utils.sol',41);
            emit __StatementCoverageUtils('/Volumes/Data/Projects/Unlock-dApp/contracts/Utils.sol',13);
j /= 10;
        }
emit __CoverageUtils('/Volumes/Data/Projects/Unlock-dApp/contracts/Utils.sol',43);
        emit __StatementCoverageUtils('/Volumes/Data/Projects/Unlock-dApp/contracts/Utils.sol',14);
return string(bstr);
    }
}
